"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["2431"],{26987:function(e){e.exports=JSON.parse('{"name":"Release","url":"https://codeberg.org/woodpecker-plugins/release","icon":"https://codeberg.org/woodpecker-plugins/release/raw/branch/main/release.svg","description":"Plugin to create a release and upload assets","docs":"<h1>plugin-release</h1>\\n<p>Woodpecker CI plugin to create a release and upload assets in the forge.</p>\\n<p>If the release already exists matching the tag, it will be used without overwriting. Files will still be uploaded based on the <code>file-exists</code> setting.</p>\\n<p>Supports Gitea, Forgejo and GitHub.</p>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>api-key</code></td>\\n<td><em>none</em></td>\\n<td>API access token</td>\\n</tr>\\n<tr>\\n<td><code>files</code></td>\\n<td><em>none</em></td>\\n<td>List of files to upload (accepts <a href=\\"https://pkg.go.dev/path/filepath#Match\\">globs</a>)</td>\\n</tr>\\n<tr>\\n<td><code>file-exists</code></td>\\n<td><code>overwrite</code></td>\\n<td>What to do if files already exist; one of <code>overwrite</code>, <code>fail</code>, or <code>skip</code></td>\\n</tr>\\n<tr>\\n<td><code>checksum</code></td>\\n<td><em>none</em></td>\\n<td>Generate checksums for specific files</td>\\n</tr>\\n<tr>\\n<td><code>checksum-file</code></td>\\n<td><code>CHECKSUMsum.txt</code></td>\\n<td>name used for checksum file. <code>CHECKSUM</code> is replaced with the chosen method (default: <code>CHECKSUMsum.txt</code>)</td>\\n</tr>\\n<tr>\\n<td><code>checksum-flatten</code></td>\\n<td><code>false</code></td>\\n<td>include only the basename of the file in the checksum file</td>\\n</tr>\\n<tr>\\n<td><code>target</code></td>\\n<td><code>CI_REPO_DEFAULT_BRANCH</code></td>\\n<td>Branch where further development happens (usually <code>main</code>)</td>\\n</tr>\\n<tr>\\n<td><code>draft</code></td>\\n<td><code>false</code></td>\\n<td>Create a draft release</td>\\n</tr>\\n<tr>\\n<td><code>skip-verify</code></td>\\n<td><code>false</code></td>\\n<td>Visit <code>base-url</code> and skip verifying certificate</td>\\n</tr>\\n<tr>\\n<td><code>prerelease</code></td>\\n<td><code>false</code></td>\\n<td>Create a pre-release</td>\\n</tr>\\n<tr>\\n<td><code>base-url</code></td>\\n<td><code>CI_FORGE_URL</code></td>\\n<td>Base URL</td>\\n</tr>\\n<tr>\\n<td><code>upload-url</code></td>\\n<td><code>https://uploads.github.com/</code></td>\\n<td>upload url for GitHub</td>\\n</tr>\\n<tr>\\n<td><code>note</code></td>\\n<td><em>none</em></td>\\n<td>File or string with notes for the release (ex: changelog)</td>\\n</tr>\\n<tr>\\n<td><code>title</code></td>\\n<td><em>none</em></td>\\n<td>File or string with the title for the release</td>\\n</tr>\\n<tr>\\n<td><code>env-file</code></td>\\n<td><em>none</em></td>\\n<td>Path to a <code>.env</code> file to load</td>\\n</tr>\\n<tr>\\n<td><code>overwrite</code></td>\\n<td><code>false</code></td>\\n<td>force overwrite existing release information (title, note and publish if release was draft before and <code>draft=true</code>, discussion category if none)</td>\\n</tr>\\n<tr>\\n<td><code>discussion-category</code></td>\\n<td><em>none</em></td>\\n<td>create a discussion in the given category (github)</td>\\n</tr>\\n<tr>\\n<td><code>generate-release-notes</code></td>\\n<td><code>false</code></td>\\n<td>automatically generate GitHub release notes</td>\\n</tr>\\n<tr>\\n<td><code>env-file</code></td>\\n<td><em>none</em></td>\\n<td>load env vars from file</td>\\n</tr>\\n</tbody></table>\\n<h2>Access Token</h2>\\n<h3>Gitea</h3>\\n<p>The access token must have the scopes <code>repo</code> (&lt;=1.19) or <code>write:repository</code> and <code>read:misc</code> (&gt;=1.20).</p>\\n<h2>Example</h2>\\n<pre><code class=\\"language-yaml\\">publish:\\n  image: woodpeckerci/plugin-release\\n  settings:\\n    files:\\n      # Could also be \\"hello-world*\\" to match both\\n      - \'hello-world\'\\n      - \'hello-world.exe\'\\n    api_key:\\n      from_secret: ACCESS_TOKEN\\n</code></pre>\\n","tags":["release","publish"],"author":"Woodpecker Authors","containerImage":"woodpeckerci/plugin-release","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-release","verified":true,"iconDataUrl":"data:image/svg+xml;base64,"}')}}]);